import React from 'react';
import "./Resume.css";

function Resume() {
    return (
        <div className="ResumeDiv">
            <h1 className="ResumeDiv">Sugene's Resume</h1>
            <h3 className="ResumeDiv">Languages and Technologies</h3>
            <div className="ResumeDiv">
                <strong>Languages: </strong>HTML5, CSS3, PHP, JavaScript, SQL, AMPScript, RPL, React, Angular, TypeScript, Node.js, Express, Heroku, Python, Selenium
            </div>
            <div className="ResumeDiv">
                <strong>Technologies: </strong>Salesforce Marketing Cloud, Pardot, Oracle Responsys, Emarsys, Visual Studio, Litmus, Email On Acid, Wordpress, Canva, Adobe Photoshop, Adobe InDesign, Microsoft Office Suite
            </div>
        </div>
    )
}

export default Resume;
